import React,{useState} from 'react'
import {Tabs, Tab, Breadcrumb} from "react-bootstrap"
import OmnibusMasViajes from './OmnibusMasViajes';


const Reportes = () => {
    const [key, setKey] = useState("home");
  return (
    <Tabs
      id="controlled-tab-example"
      activeKey={key}
      onSelect={(k) => setKey(k)}
      className="mb-3"
    >
      <Tab eventKey="home" title="Home">
        <Breadcrumb>
          <Breadcrumb.Item active>Omnibus </Breadcrumb.Item>
          <Breadcrumb.Item active>Omnibus Mas Viajes</Breadcrumb.Item>
        </Breadcrumb>
        <OmnibusMasViajes />
      </Tab>
      <Tab eventKey="profile" title="Profile">
        <h2>Esto es el primer eslot</h2>
      </Tab>
      <Tab eventKey="contact" title="Contact">
        <h3>Esto es el tercer eslot</h3>
      </Tab>
    </Tabs>
  );
}

export default Reportes;
